import React from 'react';
import './App.css';



var cats=[
{name: 'cat1', url:'http://cdn3-www.cattime.com/assets/uploads/2011/08/best-kitten-names-1.jpg'},
{name: 'cat2', url:'http://inspirationseek.com/wp-content/uploads/2016/02/Cute-Kitten-Pics_32.jpg'}];


function App() {
  return (
    <div className="App">
      <header>
          <p className="Title">
            Cat Clicker App
          </p>
      </header>
      <div className="Panels">
        <div className="LeftPanel">
          <p>HELLO</p>
        </div>
        <div className="MidPanel">
          <p>Hey</p>
        </div>
        <div className="RightPanel">
          <p>Hello</p>
        </div>
      </div>
    </div>
  );
}

export default App;
